ngs in their life, and give justice to those who refuse it.\u003cbr\u003e\u003cbr\u003eHe doesn&#39;t want ANY of us to go to Hell and die for continuing in evil and rejecting His way to life, thats why He died FOR us. He wants us to be His and begin to follow His life of love and service through Him (not ourselves as it&#39;s impossible without depending on His power and instruction). So long as we keep our hearts near to Christ through His strength, strive to obey His will of perfect love revealed in the Bible, and ask Him to help us in the midst of (very certain) pitfalls and struggles, we will, in time, win the victory over sin, pain and DEATH through Christ. Even if you are willing to be made willing, or struggling or doubtful, simply be honest and tell Him that. He hears and will answer. If we pray for Him to come in then He will. \u003cbr\u003eNOTE: You are NEVER too sinful or messed up that God cannot turn your life around through Jesus. EVER.\u003cbr\u003e\u003cbr\u003eIf you have any questions let me know!",
